e\"><img src=\"https://randomcategory.com/wp-content/uploads/sites/2/2025/04/img_4518-768x1024.jpg\" alt=\"\" class=\"wp-image-847\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Had a whole conversation with mom about these just the day before. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Spicy Splash Suppressor','','publish','closed','open','','spicy-splash-suppressor','','','2025-04-17 01:19:55','2025-04-17 05:19:55','',0,'https://randomcategory.com/?p=848',0,'post','',0),(849,1,'2025-04-13 18:34:19','2025-04-13 22:34:19','<!-- wp:image {\"id\":847,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://randomcategory.com/wp-content/uploads/sites/2/2025/04/img_4518-768x1024.jpg\" class=\"wp-image-847\"/></figure>\n<!-- /wp:image -->','Spicy Splash Suppressor','','inherit','closed','closed','','848-revision-v1','','','2025-04-13 18:34:19','2025-04-13 22:34:19','',848,'https://randomcategory.com/?p=849',0,'revision','',0),(850,1,'2025-04-13 18:36:16','2025-04-13 22:36:16','<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":123,\"sizeSlug\":\"medium\",\"linkDestination\":\"media\",\"align\":\"left\"} -->\n<figure class=\"wp-block-image alignleft size-medium\"><a href=\"https://randomcategory.com/wp-content/uploads/sites/2/2025/03/IMG_4453-rotated.jpeg\"><img src=\"https://randomcategory.com/wp-content/uploads/sites/2/2025/03/IMG_4453-225x300.jpeg\" alt=\"\" class=\"wp-image-123\"/></a></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Can’t even remember when this was, but undoubtedly cranstoned </p>\n<!-- /wp:paragraph -->','Fellas','','inherit','closed','closed','','122-revision-v1','','','2025-04-13 18:36:16','2025-04-13 22:36:16','',122,'https://randomcategory.com/?p=850',0,'revision','',0),(851,1,'2025-04-13 18:37:08','2025-04-13 22:37:08','<!-- wp:paragraph -->\n<p><strong>The</strong> <strong>Problem</strong>: Every day I’m faced with a new set of things to do, and as a manager, I need to decide who on the team is best to do them. Some things are easy and quick wins, but most are not. Some are area-focused (for example, Business Continuity tasks are given to the Business Continuity manager, and not the finance manager), but all of these things are incomplete, nebulous, unclear and difficult to get off the ground.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>They may be the ideas of leaders in my organization, stakeholders, or even my ideas. But there’s one critical thing that all of these things have in common: they need to be finished.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Most people would say “… no kidding“, but I’m not talking about getting the thing done; I’m talking finished. Essentially, Finished is used when something is complete, there is no more to be done, no further to fall, or no work left to do, and so on. Done is used when you aren’t doing any more; It’s a choice… a decision – you chose to stop.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Reading the words that describe the thing to do will help get it done. Interpreting what the goal of those words are is what gets you finished.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Starting’s Easy… </strong>Starting a task or to-do is easy; Optimism reigns supreme! The thing is new and shiny. It seems doable, and for many, the challenge for starting something new is an adrenaline rush. But, then the adrenaline starts to wear off. The issues related to this new thing starts to show through, and more often than not, the big issue is defining done; “How am I ever going to get this done?” I want people to think about finishing.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>What’s the difference? </strong>In my mind, plenty.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Idiomatically, though, there’s a slight difference between “I’m done” and “I’m finished“. In the context where someone has been working, either might be used if they have completed their task – but “I’m done” might be used for them giving up on the task, at least temporarily. “I’m finished” won’t be used for that as often. However, they both take that meaning if you add, for example, “…for the night“:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>I’m done for the night. vs. I’m finished for the night.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Both mean that you’re stopping working for the night. There’s also an idiomatic use of “I’m finished” that you wouldn’t expect to be able to use interchangeably with done. That’s when you are using it to indicate that your situation is completely unrecoverable.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>“That’s it. I can’t make rent on the shop this month, and there’s no way I can get another loan. I’m finished…“ That would mean that the business is going to go under, there’s nothing that can be done to save it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Being done is the result of staying in between the lines when interpreting what activities needed to happen; It’s a conscious decision that someone (or a group) makes. Finished is a natural conclusion that occurs once the goals of the thing are truly understood. *Going Forward: In today’s world tasks and to-do’s are like icebergs; There is a lot more that you don’t see that will make or break your success. People need to look below the water line to discover what is needed to be successful… to be finished. Driving home a task or project used to be the job of a Project Manager. Now it’s everyone’s job. As much as people strive to clarify what is needed, ambiguity will always reign.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Think bigger; Ask questions; Do more; Be a leader… <strong>Finish</strong>.</p>\n<!-- /wp:paragraph -->','People need to Finish','','inherit','closed','closed','','153-revision-v1','','','2025-04-13 18:37:08','2025-04-13 22:37:08','',153,'https://randomcategory.com/?p=851',0,'revision','',0),(852,1,'2025-04-13 18:37:24','2025-04-13 22:37:24','<!-- wp:paragraph -->\n<p>on a trail marker at Rockefeller Park, and totally right!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":688,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://randomcategory.com/wp-content/uploads/sites/2/2025/03/IMG_4493-768x1024.jpeg\" alt=\"\" class=\"wp-image-688\"/></figure>\n<!-- /wp:image -->','You are beautiful','','inherit','closed','closed','','687-revision-v1','','','2025-04-13 18:37:24','2025-04-13 22:37:24','',687,'https://randomcategory.com/?p=852',0,'revision','',0),(853,1,'2025-04-13 18:38:20','2025-04-13 22:38:20','<!-- wp:image {\"id\":702,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"https://randomcategory.com/wp-content/uploads/sites/2/2025/04/IMG_4510-768x1024.jpeg\" alt=\"\" class=\"wp-image-702\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>in the course of modern computer history, no drive held such control. “Will I show you the data or not,” all this AND a few scratchy seconds before the event unfolds … uh oh - drive unreachable! </p>\n<!-- /wp:paragraph -->','1.44… look what i found','','inherit','closed','closed','','701-revision-v1','','','2025-04-13 18:38:20','2025-04-13 22:38:20','',701,'https://randomcategory.com/?p=853',0,'revision','',0),(855,1,'2025-04-15 13:01:57','2025-04-15 17:01:57','<!-- wp:html -->\n<ul>\n<li><b><a href=\"https://gmail.com\">Gmail</a></b> [sanz.andre@gmail.com]</li>\n<li><b><a href=\"https://epicmychart.optum.com/MyChart/Home\">MyChart</a></b></li>\n\n</ul>\n<!-- /wp:html -->','Links','','inherit','closed','closed','','100-revision-v1','','','2025-04-15 13:01:57','2025-04-15 17:01:57','',100,'https://randomcategory.com/?p=855',0,'revision','',0),(856,1,'